import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
// import '../css/style.css';
import './Navbar.css';

function Navbar() {
  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };

  useEffect(() => {
    showButton();
  }, []);

  window.addEventListener('resize', showButton);

  return (
    <>
      <nav className='navbar'>
        <div className='navbar-container'>
          <Link to='/' className='navbar-logo' onClick={closeMobileMenu}>
            <i className='fab fa-react' />
            <svg width="27" height="36" viewBox="0 0 27 36" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M5.24904 34.5529L0 36V7.35392L5.24904 5.90681V34.5529Z" fill="#A30A24" />
                <path
                    d="M13.1155 11.294V9.74164L26.7183 5.9989V0L7.07715 5.4069V18.9505L26.7183 13.5502V7.55125L13.1155 11.294Z"
                    fill="#A30A24" />
                <path
                    d="M20.6799 24.3113V22.759L7.07715 26.5017V20.5028L26.7183 15.0959V28.6461L7.07715 34.053V28.0541L20.6799 24.3113Z"
                    fill="#A30A24" />
            </svg>
          </Link>

          <div className='menu-icon' onClick={handleClick}>
            <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
          </div>

          <ul className={click ? 'nav-menu active' : 'nav-menu'}>
            <li className='nav-item'>
              <Link to='/' className='nav-links' onClick={closeMobileMenu}>
                Home
              </Link>
            </li>
            <li className='nav-item'>
              <Link to='/capabilities' className='nav-links' onClick={closeMobileMenu}>
                Capabilities
              </Link>
            </li>
            <li className='nav-item'>
              <Link to='/works' className='nav-links' onClick={closeMobileMenu}>
                Works
              </Link>
            </li>

            <li className='nav-item'>
              <Link to='/studio' className='nav-links' onClick={closeMobileMenu}>
                Studio
              </Link>
            </li>

            <li className='nav-item'>
              <Link to='/contact' className='nav-links' onClick={closeMobileMenu}>
                Contact Us
              </Link>
            </li>
          </ul>
          {button}
        </div>
      </nav>
    </>
  );
}

export default Navbar;
